INSERT INTO `about_nicare` (`about_nicare_id`, `about_nicare`) VALUES
(1, '        <p> Niger State Contributory Health Scheme (NGSCHS) is a healthcare financing reform (Social Health Insurance Scheme) which operates on the principles of harmony, risk- sharing and pooling of resources for the provision of affordable, accessible and qualitative healthcare to Niger State workforce and residents alike on a sustainable basis.</p>\n\n');
INSERT INTO `applications` (`id`, `app_heading`, `app_title`, `app_acronym`, `app_description`, `status`) VALUES
(1, 'Enrolment', 'Enrolee Enrolment System', 'EES', 'This is the online/web version of the Enrollee Enrolment System (EES) of Tonic Insurance Solutions (TiS) deployed for the administration of Niger State Contributory Health Scheme (NiCare) to residents of Niger State by the Niger State Contributory Agency (NGSCHA)\'', '1'),
(2, 'TPA Portal', 'Third Party Agent Portal\r\n', 'TPA', 'This is a web portal designed to allow TPAs access to the Premium Voucher PINs Production System (PVPS); a system responsible for the request, generation and management of well secured digital premium voucher pins to ease premium subscriptions. TPAs are configured to be able to request and activate pins through the TPA portal. They can also access Enrolments, Claims, Referral, Encounter etc reports for their allocated Health Zones (LOTs).', '1'),
(3, 'Administration', 'Enrolee Information Management System', 'EIMS', 'This system is a web portal system responsible for the production and management of a well secured digital premium voucher pins designed to ease premium subscriptions and accountability. TPAs (Banks) are configured to be able to request and activate pins through the TPA portal or mobile pin request and activation subsystems of the PVPS', '1'),
(4, 'Claim Management', 'Referral and Claim Management System', 'RCMS', 'This system is one of the most important innovations of the scheme. It is web portal system designed to handle all Fee-For-Service (FFS) claims from secondary and tertiary providers.  This system is designed to enable the scheme performs claims management efficiently in real time.', '1'),
(5, 'Provider Portal', 'Providers Portal System', 'PP', 'This system is one of the most important innovations of the scheme. It is web portal system designed to provides the providers with the details of their transactions.  This system is designed to enable the scheme providess the providers withe the needed information.', '1');
