INSERT INTO `departments` (`id`, `department_name`, `department_responsibility`, `department_head`, `department_strength_staff`, `status`, `head_image`) VALUES
(1, 'EXECUTIVE SECRETARY (ES OFFICE)', '.', 'Dr. Mohammed B. Usman', '237', '1', '1-IMG-20190219-WA0002.jpg'),
(2, 'ADMINISTRATIVE DEPARTMENT', 'He holds Bachelor of Science degree in Public Administration from the University of Abuja in 2017. He joined Niger State Civil Service in 1988 and has gained over 25 years experience in various organizations with the State Civil Service. He got elevated into management cadre where he served as the Director Administration currently with Niger State Contributory Agency. He is currently undergoing his Masters degree in Public Administration with special emphasis on peace and conflict management with the National Open University of Nigeria.', 'Alhaji Mohammed Ndanusa Gaba (B.sc Public Admin)', '578', '1', '2-DIRECTOR ADMIN.jpg'),
(4, 'PROVIDER &amp; BENEFIT MANAGEMENT DEPARTMENT', 'He holds the MBBS degree of the University of Maiduguri Medical College. He also holds a Masters of Technology degree in Disaster Risk Management and Development studies from Federal University of Technology, Minna. He just completed the Masters of Health Economics programme at Bayero University, Kano. He was Head of Hospital Services (HHS) at General Hospitals Bida, Kontagora and Tungan Magajiya at various times.  He was appointed as Director Department of Quality Assurance and Standards of Niger State Contributory Health Agency in February, 2018.', 'Dr. Bello Tukur (MBBS,MDRM). ', '', '1', '4-DR BELLO TUKUR.jpg'),
(5, 'PROGRAMME &amp; BUSINESS DEVELOPMENT DEPARTMENT', 'He headed Pharmacy Department in several Hospitals in Niger State notably General Hospital Suleja (second biggest Hospital) and General Hospital Minna (biggest Hospital) in the State.  Having practice for over 15 years in the State with resource constrain he developed another interest on Healthcare Financing and led him to study Masters in Health Economics from Bayero University, Kano. He rose to the rank of senior Consultant Clinical Pharmacist at G.H Minna. He is appointed as Director Program of Niger State contributory Health Agency with responsibility of mobilising resources and all residents of the state in achieving universal health coverage. ', 'Pharm. Shehu Attahiru Malagi (B.PHARM, FWAPCP MHE).', '', '1', '5-DPS MALAGI.jpg'),
(6, 'PLANNING RESEARCH AND STATISTICS DEPARTMENT', 'Pharm Abdul Musa earned a Bachelor of Pharmacy degree from Ahmadu Bello University, Zaria, in 1997. He joined the Niger State Civil Service in 199 8 and gained over 15 years Clinical experience in various hospitals across Niger State. He became a Consultant Clinical Pharmacist/ Fellow of the West African Postgraduate College of Pharmacists (FWAPCP) in 2012.He also bagged a Postgraduate Diploma in Public Administration from Niger State Polytechnic, Zungeru. On elevation into management cadre, he served as the Director Planning, Research, M', 'Alhaji Ibrahim Mahmood (M.sc,PGDPA,HND STAT,HND COMP,HIM) ', '', '1', '6-DPRS.jpg'),
(7, 'INFORMATION AND COMMUNICATION TECHNOLOGY (ICT) DEPARTMENT', 'He also worked with Niger State Hospitals Management Board as Desk Officer NHIS, (2013-2015), General Hospital Bida and State Ministry of Health.   He has over twenty five years working in the state with wide experience in health insurance, health services, public administration, and ICT.   Alhaji Ibrahim Mahmood has a Master in Public Administration, Higher National Diploma in Statistics, National Diploma in Medical Records, Diploma in Data Processing and many other certificates. Alhaji Ibrahim Mahmood is spearheading the initiation and implementation of the ICT Platform for Niger State Contributory Health Agency (NGSCHA) ', 'Alhaji Ibrahim Mahmood (M.sc,PGDPA,HND STAT,HND COMP,HIM) ', '', '1', '7-DICT.jpg');
INSERT INTO `departments_units` (`id`, `unit_title`, `unit_head`, `unit_responsibility`, `unit_description`, `unit_head_image`, `unit_department_id`, `status`) VALUES
(1, 'Personal Assistant (PA) to ES', 'HASSAN MUHAMMAD AMINU (HND Computer Science)', 'He is formerly the PA to Director Public Health in the State Ministry of Health. The PA coordinates the activities of the ES office and receives mails on behalf of the ES  ', '', '1PA TO ES.jpg', 1, '1'),
(2, 'Public Relation Officer (PRO)', 'MARIAM UMAR (HND Mass Communication)', 'Responsible for the image building of the Agency and information dissemination within and outside the Agency, served as mouth piece of the Agency through the Media and the General Public. ', '', '2PRO.jpg', 1, '1'),
(3, 'Chief Internal Auditor (CIA)', 'MR EMMANUEL. S. THOMAS', 'The unit is responsible to ensure all payment vouchers for their charges are backup with relevant supporting documents', '', '3CIA.jpg', 1, '1'),
(4, 'Human Resources (HR) Unit', 'MOHAMMAD B. YAHAYA ', 'The unit coordinates and supervise all administrative activities for the DA approval, In charge of Agency capacity building, In charge of Staff general welfare. The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the HR unit. The unit has the following cadre of staff: Human Resource Officer.', '', '4HEAD HUMAN RESOURCES.jpg', 2, '1'),
(5, 'General Admin (GA) Unit', 'Tanko Madaki (ND in public Admin.)', 'The unit is In charge of maintenance of vehicle/ transport, Programme officer, respond to circular or Correspondence, In charge of  Staff List. The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the GA unit. The unit has the following cadre of staff: General Admin Officer, O/C Open Registry, O/C Secret Registry', '', '5GENERAL ADMIN.jpg', 2, '1'),
(6, 'Accounts Unit', 'AWWAL YAHAYA (HND in Accounting)', 'The unit is responsible for Advise and supervise all financial activities of the Agency, Signatory to all Account of the Agency, Write E-payment letters to Banks, Sign payment Vouchers. The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Accounts unit. The unit has the following cadre of staff:  â€¢	Cashier, Treasury Officer', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Accounts unit. The unit has the following cadre of staff: Cashier, Treasury Officer', '6HEAD ACCOUNT.jpg', 2, '1'),
(7, 'Accreditation and Quality Assurance (A&amp;QA) Unit', 'DR. KHADIJAT MOHAMMED A. (MBBS, MPH) ', 'The unit is responsible for coordinating and documenting review of Health facilities, Review progress report and coordination of accreditation and re-accreditation. The unit has the following cadre of staff: Accreditation Officers (4 Staff)', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Accreditation .', '7DR KHADIJAT.jpg', 4, '1'),
(8, 'Enforcement Unit', 'PHARM. AMINA NANA KOLO (B.pharm,Msc', 'The unit is responsible to ensure that establishment with five (5) or more employees are registered with the Agency, to liaise with stakeholders to get the actual number of existing and establishment with more than (5) employees, inspection of record to ensure that they comply with set guidelines, dealing with non-compliance to guidelines. ', 'The head of the unit, a distinguished and hardworking pharmacist has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Enforcement unit', '8-HEAD ENFORCEMENT.jpg', 4, '1'),
(9, 'Investment Unit', 'MUSA A. ISAH KUCHI (B.sc Business Admin.)', 'The unit is responsible to Advice the Agency on investment opportunity, monitor and kept records of investment contribution by the Agency, write quarterly, annually on investment contribution details for record purpose', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Investment unit. ', '9-HEAD INVESTMENT.jpg', 2, '1'),
(10, 'Store ', 'Francis Gajere (HND) ', 'Responsible for Retirement of financial record, Contact sign receipt and issuance of vouchers, payment without store supporting documents this violate financial instruction.', '', '10IMG-20190315-WA0070.jpg', 2, '1'),
(11, 'Health Maintenance Unit', 'Dr. saleh Sa adu Galma (MBBS/MPH)', 'The unit is responsible to approve authorization code following generation by the ICT, Review and confirming the claims by the providers, vetting the claims before re-imbursement. ', 'The head of the unit, a distinguished and hardworking Medical Doctor has worked in several agencies and departments of the State Ministry of Health at various capacities before being deployed to NGSCHA to head the  Health Maintenance unit.', '11-HEALTH MAINTENANCE.jpg', 4, '1'),
(12, 'Informal Sector (IS)Unit', 'HABIBAH LAMI UMAR (B.sc Econs, MHE).', 'The unit is responsible for the management of informal sector enrolees, mobilizing informal sector beneficiaries. The head of the unit, has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Informal Sector unit', '', '12-HEAD INFORMAL SECTOR.jpg', 5, '1'),
(13, 'Mobilization Unit', 'HALIMA A. BAHAGO (BCNS/M.sc)', 'The unit is responsible for the mobilization of formal and informal sector enrollee.  the head of the unit, has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Mobilization unit. The unit has the following cadre of staff: Mobilization Officers (3 Staff), ', '', '13HEAD MOBILIZATION UNIT.jpg', 5, '1'),
(14, 'Liaison Office Unit ', 'Shehu mohammed maidawa (B.sc Health Education)', 'Liaison Officer to LGAs, Provide the citizens with direct access to Health care services, Responsible for coordinating the LGAs across the state, facilitating meeting and cooperation among the Agency. The unit also has a liaison Officer for NSPHDA.', '', '14-HEAD LIAISON UNIT.jpg', 5, '1'),
(15, 'Monitoring and Evaluation (M&E) Unit', 'ISAH IBRAHIM EBBAH (HND/BSc Pubic Health), ', 'The unit is responsible for the monitoring and evaluation programs (projects), provides leadership on the design of survey & monitoring instruments, Carrying out M &E activities needs assessment reports, policy and program documents. Support supervision of M&E planning and Management. Supervise the actives of junior staff members', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the M&E unit.', '15-HEAD M&E.jpg', 6, '1'),
(16, 'Procurement Unit', 'MOHAMMAD ADAMU (HND in Business Admin.), ', 'The unit is responsible for the conduct market survey on the price of goods and services, maintain electronic and manual record of procurement, participate the supervisor at contractor or supplier site, maintains frequent communication with Niger state Public Procurement board, Advice the Agency on the procurement Matters. ', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Procurement unit', '16HEAD PROCUREMENT .jpg', 6, '1'),
(17, 'Research Unit', 'ABDULLAHI USMAN BABADOKO (R/Nurse, B.sc Sociology)', 'The unit is responsible to provide Leadership to the Unit, To conduct and Participate in Survey, To assist in research Methodology and Facilitate M &E need Assessment for research. ', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Research unit.', '17HEAD RESEARCH UNIT.jpg', 6, '1'),
(18, 'Health Planning (HP) Unit', 'SOLOMON YISA (Dip Stat/ADHSSM)', 'The unit is responsible in taking charge of the unit and provide leadership to the staff of the unit, Ensure the development of annual budget and work plans of the scheme, Responsible for preparation of the scheme quarterly, mid-year/ annual progress report, Analysis and articulation of government policies as they affect health insurance.   ', 'The head of the unit has worked in some other MDAs of the State at various capacities before being deployed to NGSCHA to head the Health Planning unit.', '18-SLOMON YISA.jpg', 6, '1'),
(19, 'The System Administrator/Analyst (SA)', 'MOHAMMED ALIYU BUSU (B.Tech Maths/Comp. Sci., M.Tech. Comp. Sci. AMInsTa), ', 'The System Admin who also double as system analyst is responsible Sit-in for the director when he is absent, Directs/Transmit directives from the director to units, Oversee the Premium Voucher Pins production, Ensure systems annual subscriptions are done and up to date, Organize and oversee systemsâ€™ users trainings, Ensuring smooth day-to-day functioning of the schemeâ€™s ICT platforms, Performs as a project lead and ensure the delivery of ICT projects of the scheme on time and within budget, Liaising with clients and colleagues to assess and define what solution or system is needed, Supervising the installation and configuration of software, hardware and network the System Admin of the Agency  He has worked in some other MDAs of the State at various capacities last being the O/C ICT, Niger State Hospitals Management Board before being deployed to NGSCHA System Admin. ', 'The System Admin of the Agency has worked in some other MDAs of the State at various capacities last being the O/C ICT, Niger State Hospitals Management Board before being deployed to NGSCHA System Admin.\r\n', '19-SYSTEM ADMINISTRATOR.jpg', 7, '1'),
(20, 'Database Administration (DBA) Unit', 'Amina Tanko (HND,PGD,HIM)', 'The Database Admin unit is responsible Production of Enrolees ID cards, Production of Key Performance Indicators (KPIs) Dashboards, Generation and Management of Referral Approval Code ,Maintain software and databases of all sizes, Provide technical support to users. This includes help in using the products, Perform daily backup operations, Assign configuration of authentication, authorization, privileges, and manage users, maintaining existing software systems.', 'The head of the unit has worked in some other MDAs of the State at various capacities last being the O/C ICT, General Hospitals Minna before being deployed to NGSCHA as head Database Admin. ', '20-DBA.jpg', 7, '1'),
(21, 'Hardware Administration (HA)Unit', 'AWWAL DIKKO (ND,HIM)', 'tThe Hardware Admin unit is responsible Provides preventive and corrective maintenance of equipment and hardware, Keeping records and Stock taking of equipment and hardware, Investigate and report hardware and network problems, Repair/solve hardware and network issues, Administer servers, desktop computers, printers, routers switches, phones, personal digital assistants, smartphones, security updates and patches, Monitor networks to ensure security and availability to specific users, Training of systems users. ', 'The head of the unit has worked in some other MDAs of the State at various capacities last being the O/C2 ICT, , Niger State Hospitals Management before being deployed to NGSCHA as head Hardware Admin...', '21-HEAD HARDWARE.jpg', 7, '1'),
(22, 'Legal Adviser', 'BAR. MAMMA DANTSOFO (LLB/BL)', ' The Legal Adviser provides legal advice and services for the Agency', 'She is the legal adviser to the Agency...', '22LEGAL.jpg', 1, '1');
