INSERT INTO `faqs` (`id`, `question`, `answer`, `status`) VALUES
(1, 'What is social health insurance?', 'Is a social health security system that guarantees the provision of a benefit package of health services paid from funds created by pooling the contributions of participants. It operates on the principles of harmony-‘’my brother’s keeper’’, risk sharing and pooling of resources.', '1'),
(2, 'What is Niger state contributory health scheme?', 'Is the Niger State Social Health Insurance Scheme a health security system in which health care of all residents are paid from funds created by pooling the contributions of participants.', '1'),
(3, 'What is the benefit of this Scheme?', 'When any individual or members of a family fall sick or require healthcare services in already chosen health facility, there will not be any form of direct payment at point of service.\nWhen registered with the scheme, it will cost a token to use quality healthcare e.g. treatment for common illness like Malaria, Typhoid fever, antenatal care, delivery, common surgical operations like Caesarean section, Appendectomy, Hernia and many more.\nAll residents can then save money which would have been spent by paying high hospital bills.\nNo payment of money for medical check-up and laboratory tests for every registered person\n', '1'),
(4, 'Who is the beneficiary under the scheme?', 'All residents of Niger state registered under the scheme who can either be from formal or informal sector.', '1');
