INSERT INTO `membership` (`id`, `registration`, `access`, `replacement_of_card`, `membership_info`, `offences`, `status`) VALUES
(1, '<ol>\r\n	<li>To register as a subscriber of NiCare, you have to belong to one of the following categories and must obtain a valid premium voucher pin from NiCare or its Agents:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Formal Sector: If you are registering as a formal sector employee, please note that you will pay premium of 2.5% of your basic salary in addition to 2.5% counterpart from your employer deductible from salary source every month.</li>\r\n	<li>Informal Sector: If you are registering as an annual premium paying member (Informal sector), please note that you will pay an annual premium of N7,200 per individual and N43,200 per family of six (1 principal, 1 spouse &amp; 4 children of less than 18 years) once every year for renewal</li>\r\n	<li>Vulnerable (Exempt group): If you are registering as a member of the exempt group (vulnerable), please note that you will be required to have proof of exemption (vulnerability), e.g.&nbsp; Indigents, evidence of aged above 65 years, other categories prescribed by the NiCare/Niger State Government. You will then be registered without paying premium and you will be required to renew your membership every year.</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;2. At registration point, for the Informal subscriber, the registration officer will collect your already filled enrolment form to capture the data&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; on it into the enrolment system. You will need to provide the following personal and other particulars:</p>\r\n\r\n<ol>\r\n	<li>Full Name</li>\r\n	<li>Date of Birth</li>\r\n	<li>Age</li>\r\n	<li>Marital Status</li>\r\n	<li>Mobile phone numbers</li>\r\n	<li>Dependents (spouse &amp; children) information if married, and</li>\r\n	<li>Other supporting information</li>\r\n</ol>\r\n\r\n<p>&nbsp; &nbsp;For the Formal subscriber, the beneficiary will logon to the NiCare online enrolment portal to validate the premium pin and provide&nbsp; &nbsp; &nbsp; &nbsp; personal&nbsp; and dependents information.</p>\r\n\r\n<p>&nbsp; &nbsp;3.&nbsp; After taking your personal particulars and payments, the registration officer will take your photograph and biometric information.</p>\r\n\r\n<ul>\r\n	<li>During the taking of your photograph, you should open your eyes and look straight into the camera. You should also close your mouth.</li>\r\n	<li>The biometric information required is fingerprints of your ten fingers. The prints will be taken in this order: The four fingers of your right hand; the four fingers of your left hand; your two thumbs.</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;4. During registration, you will be required to select your preferred primary provider (PPP).</p>\r\n\r\n<ul>\r\n	<li>The PPP should be a primary care provider, which should be a Primary Healthcare Centre (PHC). You should make the choice yourself otherwise you will be assigned to an available primary care provider.</li>\r\n	<li>When you fall ill, you should first of all visit your PPP for treatment. If your illness cannot be treated at the primary care level, you will be referred to a higher level health care facility.</li>\r\n	<li>In an emergency, you may access health care at any health care facility.</li>\r\n	<li>You may change your PPP at determined intervals or when you change your permanent residence.</li>\r\n</ul>\r\n', '<p>To access health care with your NiCare card:</p>\r\n\r\n<ol>\r\n	<li>Go to your selected Preferred Primary Provider (PPP) with your card.</li>\r\n	<li>Present your card to the person in charge at the out-patient department or front desk of the health facility.</li>\r\n	<li>Officials of the health care facility will check the validity of the card and your biometric information.</li>\r\n	<li>Following a confirmation of the validity and your details you will be attended to.</li>\r\n	<li>Do not leave your card at the health facility after accessing health care.</li>\r\n</ol>\r\n', '<p>Your card will need to be replaced if it is:</p>\r\n\r\n<ol>\r\n	<li>Lost</li>\r\n	<li>Damaged</li>\r\n	<li>Defaced</li>\r\n	<li>Expired.</li>\r\n</ol>\r\n\r\n<p>For replacement of your card:</p>\r\n\r\n<ol>\r\n	<li>Contact the Nicare Office or NiCare agent in your community.</li>\r\n	<li>Fill a replacement form and pay the processing fee where applicable.</li>\r\n	<li>You will be issued with a new ID card</li>\r\n</ol>\r\n', '<p><strong>Rights and Responsibilities</strong></p>\r\n\r\n<p><strong>RIGHTS</strong></p>\r\n\r\n<p>Your membership of the NiCare makes you a stakeholder of the scheme. You have a responsibility to pay your premium and/or processing fee promptly and ensure that you do nothing to undermine the scheme.</p>\r\n\r\n<p>You have the right to</p>\r\n\r\n<p><strong>Possess a NiCare card:&nbsp;</strong>As a subscriber, you are entitled to a NiCare card after completing registration.</p>\r\n\r\n<p><strong>Access health care with your NiCare card:&nbsp;</strong>New subscribers serve a waiting period of three months after registration before they can access health care.</p>\r\n\r\n<p><strong>Standard treatment at the NiCare office and provider sites:</strong>&nbsp;NiCare office and provider staff shall treat you with dignity and respect. You should not be discriminated against on the basis of ethnicity, gender, disability, marital status, social origin, nationality, religion or creed.</p>\r\n\r\n<p><strong>Information from NiCare office and your health care provider:</strong>&nbsp; NiCare office shall provide you with information on which accredited health care facilities you can select as your PPP and&nbsp;when&nbsp;to&nbsp;renew&nbsp;your&nbsp;membership.<br />\r\nYour health care provider shall provide you with information about your health condition and the medicines given you. The provider shall further explain to you every procedure done on you.</p>\r\n\r\n<p><strong>Ask questions or seek clarifications at your provider sites and NiCare office:</strong>&nbsp;You have the right to ask questions or seek clarifications.</p>\r\n\r\n<p><strong>Quality health care:</strong>&nbsp;Standard medical care shall be given by qualified health care professionals in a safe and cordial environment.</p>\r\n\r\n<p><strong>NiCare prescription:</strong>&nbsp;Where a medicine which is prescribed for you is not available at the hospital or clinic, you have the right to have it prescribed for you so that you collect from a accredited pharmacy or chemical shop. At the pharmacy or chemical shop you will be asked to show your NiCare card and the prescription before being served.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>RESPONSIBILITIES</strong></p>\r\n\r\n<p>You have a responsibility to ensure that you:</p>\r\n\r\n<p><strong>Renew your NiCare membership before it expires:</strong>&nbsp;You are expected to renew your NiCare membership once every year. You are advised to commence the renewal process one month before expiry.</p>\r\n\r\n<ol>\r\n	<li>Members who fail to renew their membership from the date of expiry shall have their membership deactivated in the NiCare membership database until they renew it.</li>\r\n	<li>Defaulting members who renew their membership after one month of expiry will be required to observe a one (1) month waiting period before accessing health care under NiCare.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Do not seek health care with an expired card or expired membership:</strong>&nbsp;Do not seek health care on the NiCare when your membership or ID card is expired until you renew it.</p>\r\n\r\n<p><strong>Do not give your ID card to another person to access health care:</strong>&nbsp;This is an offence which makes you liable to punishment under the laws of Nigeria.</p>\r\n\r\n<p><strong>Do not access health care with your ID card on behalf of another person or take medicines for another person:&nbsp;</strong>The health professional will not know the exact condition the other person has, and therefore the medicines given may be harmful to that person.</p>\r\n\r\n<p><strong>Do not leave your ID card at the health care facility after receiving service:&nbsp;</strong>You should have your ID card with you at all times. You should therefore refuse any request to leave it at the facility.</p>\r\n\r\n<p><strong>Do not engage in provider shopping:</strong>&nbsp;Do not move from one health care facility to another with the same ailment or other complaints when you have not completed a course of treatment. It is dangerous to your health.</p>\r\n\r\n<p><strong>Observe the gatekeeper system:</strong>&nbsp;If you fall sick, you should first visit your preferred primary provider (PPP) for treatment. If necessary, you will be referred to a higher level health care facility. In emergency cases, however, you may access health care at any facility.&nbsp;</p>\r\n\r\n<p>If you access health care at a health care facility that is not accredited by the NiCare, you will be responsible for the payment of the bill.</p>\r\n\r\n<ol>\r\n	<li>Medicines that are not available at the hospital or clinic but are on the NiCare Medicines List can be obtained from a credentialed private pharmacy or chemical seller.</li>\r\n	<li>Report any suspected illegal monies collected from you to NiCare LGA Desk officer at LGA nearest to you or the NiCare Call Centre on....... MTN and Glo subscribers may call short code ......</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Know the benefits package:</strong>&nbsp;You have a responsibility to know the services you are entitled to under the NiCare.</p>\r\n\r\n<p>Do not indulge in any fraudulent or dishonest acts in respect of the scheme or defraud or attempt to defraud the scheme by conniving with a health care provider or other person to make a claim for any of the following:</p>\r\n\r\n<ol>\r\n	<li>A service which has not been provided;</li>\r\n	<li>A service which you do not need but which the health care provider purports to have provided;</li>\r\n	<li>A medicine prescription which you do not require or which is more than what you require.</li>\r\n</ol>\r\n', '<p>A member of the scheme who defrauds or attempts to defraud the scheme by conniving with a health care provider or other person to make a claim for;</p>\r\n\r\n<ol>\r\n	<li>A service which has not been provided</li>\r\n	<li>A service which the contributor does not need but which the health care provider purports to have provided</li>\r\n	<li>A medicine prescription which the contributor does not require or which is more than what the contributor requires</li>\r\n	<li>Indulges in any other fraudulent or dishonest act, commits an offence punishable under the law...</li>\r\n</ol>\r\n', '1');
