INSERT INTO `news` (`news_id`, `news_title`, `news_content`, `image`, `status`) VALUES
(9, 'TRAINING OF NICARE TPAs ON ENROLMENT AND TPA PORTAL PORT ONGOING', 'NiCare is holding its first session of Training for its engaged Third Party Administrators (TPAs) on Informal Sector beneficiaries enrolment and the use of TPA Portal holding at Brighter Suites in Minna, Niger State from 12th to 14th of November, 2019.', '625_950.jpg', '1'),
(13, 'TRAINING THE NIGER STATE THIRD PARTY ADMINISTRATORS IN COMMUNICATION TECHNIQUES.', '            Today we are training the niger state third party administrators in communication techniques for @nicarehealth. we are glad for the support of @results4dev and @hsclimited to conduct this training. \n.@NiCareHealth expects Third Party Administrators to cover at least 10 percent of the population slot they have been given in the first year of activity.\nThe training will avail the engaged TPAs to effectively carry out sensitization and other services using the various communication techniques.\n\n<b>Bold</b>', '619_1385.jpg', '1'),
(20, 'BREAKING: Nigeria Records 176 New COVID-19 Cases, Total Infections Now 5,621', 'Nigeria has recorded 176 new cases of the COVID-19, bringing the total number of infections in the country to 5,621.\n<p><b>The Nigeria Center for Disease Control (NCDC) announced this late Saturday.</b></p>\n\n<p>Of the new cases, 95 are confirmed to be in Lagos, 31 in Oyo, while 11 are in the FCT, Abuja.</p>\n<p>Also, eight each are in Niger and Borno states, six in Jigawa, four in Kaduna, three in Anambra, two each in Edo, Rivers, Nasarawa and Bauchi and one each in Benue and Zamfara.</p>', '597_2046.jpg', '1'),
(21, '<b>Buhari Receives Herbal Remedy For COVID-19 From Madagascar</b>', '<p><b>President Muhammadu Buhari has received a herbal remedy for the COVID-19 from Madagascar.</p></b>\n\n<p>The Senior Special Assistant to the President on Media and Publicity, Garba Shehu, announced this on Saturday in a series of tweets.</p>\n\n<p>According to Mr Garba, samples of the native remedy were brought by the President of Guinea Bissau, Umaro Embalo.</p>\n\n<p>However, he noted that President Buhari reiterated that all necessary procedures will be put in place before allowing traditional or any new medicines to be administered on Nigerians.</p>\n\n</p>“We have our institutions, systems and processes in the country. Any such formulations should be sent to them for verification. I will not put it to use without the endorsement of our institutions,” Buhari was quoted to have said.</p>\n\n<p>President Muhammadu Buhari Saturday at the State House, Abuja, received the Madagascan native formulation against the #Covid-19 pandemic, and reiterated that he will listen to science before allowing traditional or any new medicines to be administered on Nigerians.</p>\n\n<p>— Garba Shehu (@GarShehu) May 16, 2020</p>', '481_2121.jpg', '1'),
(22, 'COVID-19: Buhari Directs PTF To Work Closely With Governors', '<p>President Muhammadu Buhari has directed the Presidential Task Force (PTF) on COVID-19 to work closely with state governors.</p>\n\n<p>The President gave the directive on Monday at a virtual meeting with some members of the Nigeria Governors Forum.</p>\n\n<p>In a statement by his Special Adviser on Media and Publicity, Femi Adesina, President Buhari disclosed that the PTF had briefed him on the next steps in the national response to the pandemic.</p>\n\n<p>He explained that working closely with the governors would bring better harmony in the daunting task of curbing the spread of the pandemic.</p>\n\n<p>“I have directed that they work very closely with the Governors.</p>\n\n<p>“The pandemic was beyond technology, power, and resources, countries that had all those, were recording the highest casualties round the world.</p>\n\n<p>“We have to be very careful. We need to continue to educate and persuade the people to accept the reality of the situation, and do all that is necessary to stay safe,” the President added.</p>\n\n<p>The meeting also discussed economic and security issues, among others, with the governors commending the President on the “leadership and direction” he has given the country in combating COVID-19.</p>', '642_2250.jpg', '1');
