INSERT INTO `nicare_management` (`id`, `management_name`, `management_rank`, `management_image`, `management_about`, `status`) VALUES
(1, 'DR. USMAN B. MUHAMMED (MBBS,MPH,DTMH)', 'EXECUTIVE SECRETARY', '1-IMG-20190219-WA0002.jpg', '<h2>PROFILE IN RESPECT OF DR MOHAMMED B. USMAN</h2> Holds a bachelor of Medicine and bachelor of Surgery from the University of Jos –Nigeria. Thereafter, develop a special interest in management of the diseases of the tropics that made him to obtain training in Tropical Medicine and Hygiene from the University of Liver pool in the United Kingdom. Practice as a general medical practitioner for over fifteen years rising to the post of Principal medical Officer In-Charge of a hundred (100) bed space hospital in a rural settlement. His practice in a rural settlement within a constrain economy made him to again develop another interest in Public Health that focus in preventive care. He later acquire a Master in Community Health and Health Planning from University of Heidelberg in the Republic of Germany, to be a better public health scientist. He rose to the position of Deputy Director Environmental Health Service and later the Director of Public for the period of ten (10) years in the Niger State Ministry of Health. As a Director Public health is able to coordinate i.e. develop plan of operation, participate in implementation, supervision and monitoring & Evaluation of about 10 programmes e.g. Malaria elimination programme, HIV/AIDs control, Non Communicable Disease program, Neglected Tropical Diseases, Disease Surveillance, coordination of supporting partners e.t.c. This also include provision of outreach services, training and facilitation of events. As a result of this schedule he is able to work with donor agencies, developing partners and implementing partners. Participate in the supervision, monitoring and advisory in implementing the Niger State Millennium Development Goals/National Health Insurance Scheme/Maternal Child Health (MDG/NHIS/MCH) scheme. He is an accomplished administrator/manager with training from various institutions including: Efficiency and Performance Improvement in ASCON, Topo Badagry, Lagos- Nigeria, training in Leadership Enhancement and Accountability for Public Sector (LEAPS), training on quality Service Delivery for Sustainable  Organisational Productivity: Promotional Strategy among others. Attended numerous workshops, seminars and conferences within and outside Nigeria, among which is the 5th Scientific Conference of African Health Economics and Policy Association (AfHEA) HELD IN Accra-Ghana. Appointed the pioneer Executive Secretary / Chief Executive Officer of the established Niger State Contributory Health Agency. His passion for preventive health care has encourage him to drive the insurance scheme as a solution to the financial barrier in accessing quality healthcare by the people. Thus, contributing to achieving Universal Health Coverage (UHC) in the state. He is member of the following associations; Nigerian Medical Association, Fellow African Institute of Public Health Professionals (AIPHP) and Alumni of Healthcare Leadership Academy (HLA).        \r\n', '1'),
(2, 'MUHAMMED N. GABA (BSC PUB. ADMIN)', 'DIR. ADMINISTRATION ', '2-2-DIRECTOR ADMIN.jpg', '<p>He holds Bachelor of Science degree in Public Administration from the University of Abuja in 2017. He joined Niger State Civil Service in 1988 and has gained over 25 years experience in various organizations with the State Civil Service.</p> <p>He got elevated into management cadre where he served as the Director Administration currently with Niger State Contributory Agency.</p> <p> He is currently undergoing his Masters degree in Public Administration with special emphasis on peace and conflict management with the National Open University of Nigeria.</p>', '1'),
(3, 'DR. TUKUR BELLO (MBBS,MDRM)', 'DIRECTOR QUALITY ASSURANCE ', '3-DR BELLO TUKUR.jpg', '<p>He holds the MBBS degree of the University of Maiduguri Medical College. He also holds a Masters of Technology degree in Disaster Risk Management and Development studies from Federal University of Technology, Minna. He just completed the Masters of Health Economics programme at Bayero University, Kano. </p> <p>He has worked as a medical practitioner with Niger State government for about twenty years. Also worked as a Technical Aid volunteer in the Gambia for two years.</p><p>He was Head of Hospital Services (HHS) at General Hospitals Bida, Kontagora and Tungan Magajiya at various times.  He was appointed as Director Department of Quality Assurance and Standards of Niger State Contributory Health Agency in February, 2018. Dr. Bello Tukur is a member of the Nigeria Medical Association and was the secretary of the Niger State chapter in 2002. He is also a fellow of the Health Insurance and Managed Care Institute of Nigeria and a member of the Institute of Health Care Administrators of Nigeria. He is married with children. </p>', '1'),
(4, 'PHARM. SHEHU ATTAHIRU MALAGI (B. PHARM, FWAPCP, MHE)', 'DIR. PROGRAMMES', '4-5-DPS MALAGI.jpg', '<p>He holds a Bachelor of Pharmacy from Ahmadu Bello University, Zaria. Has a special interest in clinical Pharmacy practice which led him to West African Postgraduate College of Pharmacy, where he bagged Fellowship and then appointed as Consultant Pharmacist by Niger State Government.</p> <p>He headed Pharmacy Department in several Hospitals in Niger State notably General Hospital Suleja (second biggest Hospital) and General Hospital Minna (biggest Hospital) in the State. </p> <p>Having practice for over 15 years in the State with resource constrain he developed another interest on Healthcare Financing and led him to study Masters in Health Economics from Bayero University, Kano. He rose to the rank of senior Consultant Clinical Pharmacist at G.H Minna.</p><p>He is appointed as Director Program of Niger State contributory Health Agency with responsibility of mobilising resources and all residents of the state in achieving universal health coverage. </p><p>He is very active in professional Association, was secretary of Association of Hospital and administrative Pharmacist of Nigeria for 4 years and currently the chairman of the same association, Niger State Chapter. He has attended several conferences/workshops both local and international. He is currently pursuing Masters of Public Administration at Nigerian Defence Academy, Kaduna.  </p>', '1'),
(5, 'PHARM. ABDUL MUSA (B.PHARM, FWAPCP)', 'DIR. PLANNING, RESEARCH ', '5-6-DPRS.jpg', '<p>Pharm Abdul Musa earned a Bachelor of Pharmacy degree from Ahmadu Bello University, Zaria, in 1997. He joined the Niger State Civil Service in 199 8 and gained over 15 years Clinical experience in various hospitals across Niger State. He became a Consultant Clinical Pharmacist/ Fellow of the West African Postgraduate College of Pharmacists (FWAPCP) in 2012.He also bagged a Postgraduate Diploma in Public Administration from Niger State Polytechnic, Zungeru.</p><p>On elevation into management cadre, he served as the Director Planning, Research, M and E in the State Agency for Control of HIV/AIDS (NGSACA) from 2013 to 2018. He is currently the Director Planning, Research and Statistics, Niger State Contributory Health Agency.</p><p>He is happily married with children. His hobbies include reading, swimming and travelling. He has interest in Development/Research works.</p>', '1'),
(6, 'IBRAHIM MAHMOOD (MPA,PGD,HND,DIP. IN MED. REC.)', 'DIR. INFORMATION ', '6-DICT.jpg', '<p>Prior to his present appointment, Alhaji Ibrahim Mahmood worked as Director M and E, SACA (2015-2017). He also worked with Niger State Hospitals Management Board as Desk Officer NHIS, (2013-2015), General Hospital Bida and State Ministry of Health.</p><p> He has over twenty five years working in the state with wide experience in health insurance, health services, public administration, and ICT. </p><p>Alhaji Ibrahim Mahmood has a Master in Public Administration, Higher National Diploma in Statistics, National Diploma in Medical Records, Diploma in Data Processing and many other certificates.</p><p>Alhaji Ibrahim Mahmood is spearheading the initiation and implementation of the ICT Platform for Niger State Contributory Health Agency (NGSCHA) </p>', '1');
INSERT INTO `nicare_plans` (`id`, `plans`, `status`) VALUES
(1, '<p><strong>BASIC PLAN </strong></p>\r\n\r\n<p>The Basic plan comprises of basic Minimum Package of Health Care Services. These includes Maternal Health services, Emergency Obstetric and Neonatal Care, Labour and Delivery Care and Clinically Indicated Elective caesarian section, instrument delivery.</p>\r\n\r\n<p><strong>Benefit packages&nbsp; &nbsp;</strong></p>\r\n\r\n<table border=\"1\" cellspacing=\"0\" >\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\"2\" style=\"border-color:black; width:100.0pt\">\r\n			<p><strong>Health Care Services Area (HCSA)</strong></p>\r\n			</td>\r\n			<td colspan=\"3\" style=\"border-color:black; vertical-align:top; width:382.4pt\">\r\n			<p><strong>Programmes (Interventions)</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:123.8pt\">\r\n			<p><strong>Primary Care</strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p><strong>Secondary Care</strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p><strong>Tertiary Care</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"12\" style=\"border-color:black; width:100.0pt\">\r\n			<p><strong>Ante-natal Care (ANC)</strong></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>ANC</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>Anti-Partum Hemorrhage (APH)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Tetanus toxoid</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>Hypertensive disease case management</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Anaemia Treatment</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>Management of Pre-eclampsia (Magnesium Sulphate)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Deworming (Pregnant women)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>Management of diabetes</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Antibiotics for PROM</p>\r\n			</td>\r\n			<td style=\"vertical-align:bottom; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>IPT (Pregnant women)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Case management of malaria in Pregnant women</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>PMTCT</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Daily iron and folic acid supplementation in Pregnant women</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Haemoglobin screening and urinalysis</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Treatment of mastatis</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:bottom; width:123.8pt\">\r\n			<p>Obstetrics scan&nbsp;&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"9\" style=\"border-color:black; width:100.0pt\">\r\n			<p><strong>Labour and Delivery Care and Emergency Obstetric and Neonatal Care (EmONC)</strong></p>\r\n			</td>\r\n			<td style=\"width:123.8pt\">\r\n			<p>Labour and Delivery Management/Essential care for all women</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>Induction of labour (beyond 41 weeks)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:123.8pt\">\r\n			<p>Active management of 3rd stage of labour (AMTSL)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:132.6pt\">\r\n			<p>immediate essential newborn care with complication (Facility based deliveries)</p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.75in\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:123.8pt\">\r\n			<p>Pre-referral