INSERT INTO `nicare_programmes` (`id`, `programmes`, `status`) VALUES
(1, '<p>In order to ensure that every resident of Niger State has access to good health care services, the Niger State Contributory Health Agency (NiCare) has developed various programmes to cover different segments of the society and these are:&nbsp;</p>\r\n\r\n<p><strong>FORMAL SECTOR</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp;a. Membership</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; All employees of Niger State Government and organized private sector with not less than five (5) employees belong to this group</p>\r\n\r\n<p><strong>&nbsp; &nbsp; b. Contributions</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Formal sector contribution is 2.5% of your basic salary would be matched by your employer monthly. This is deductable from source.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp;c. Waiting Period</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Three month initial waiting period is required to allow all administrative processes to be completed</p>\r\n\r\n<p><strong>INFORMAL SECTOR</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; a.&nbsp; Membership</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; All others who do not fall in the formal sector i.e. Artisans, small business owners, Farmers, Transport workers, retirees etc.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; b. Contributions:</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Informal sector contribution will be â‚¦600 per head monthly or &nbsp;â‚¦7200.00 per head annually.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp;c.&nbsp; Waiting Period: </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Three month initial waiting period is required to allow all administrative processes to be completed</p>\r\n\r\n<p><strong>VULNERABLE GROUP</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; a.&nbsp; Membership</strong></p>\r\n\r\n<ul>\r\n	<li>Pregnant Women</li>\r\n	<li>Children Under five</li>\r\n	<li>Aged</li>\r\n	<li>Indigent</li>\r\n	<li>Disables</li>\r\n	<li>Poor of the poorest</li>\r\n</ul>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp;b.&nbsp; Contributions</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;This category of enrollees contributions are paid from BHCPF, State CRF, Philanthropists, Donor Agencies etc</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;c. Waiting Period:</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Three month initial waiting period is required to allow for all the administrative process before accessing service</p>\r\n', '1');
